  return (
    <div className="h-screen flex flex-col font-sans">
      <TopBar />
      <div className="flex-grow flex flex-col">
        <div className="flex-grow">
          <Content />
          <Home />
        </div>
        <CustomerThinks />
        <BottomBar className="mt-auto" />
      </div>
    </div>
  );
}

export default App;
